(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[3],{308:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"l\'alimentation [symbol] est retardée de [delay] minutes","[symbol] market is now opened.":"le marché [symbol] est maintenant ouvert.","[symbol] market is presently closed.":"Le marché [symbol] est actuellement fermé.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Un indicateur d\'impulsion technique qui compare le prix de clôture d\'un titre à sa gamme de prix sur une période de temps donnée. La sensitivité de l\'oscillation aux mouvements du marché peut être réduite en ajustant la période de temps ou en prenant une moyenne mobile du résultat.","Active":"Actif","Add":"Ajouter","Add new template":"Ajouter de nouveaux modèle","Add new templates":"Ajouter de nouveaux modèles","All drawings":"Toutes dessins","already exists.":"existe déja.","Area":"Zone","Available only for \\\\\\"Area\\\\\\" chart type.":"Disponible uniquement pour le type de graphique \\\\\\"Zone\\\\\\".","Available only for non-tick time intervals.":"Disponible uniquement pour les intervalles de temps sans tick.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Bill Williams a introduit l\'indicateur Alligator en 1995. L\'Alligator est autant une métaphore qu\'un indicateur. Il se compose de trois lignes, superposées sur un tableau des prix, qui représentent la mâchoire, les dents et les lèvres de la bête, et a été créé pour aider le trader à confirmer la présence d\'une tendance et sa direction. L\'indicateur Alligator peut également aider les traders à désigner des formations de vagues d\'impulsions et de correction, mais l\'outil fonctionne mieux lorsqu\'il est combiné avec un indicateur de momentum.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Les bandes de Bollinger peuvent être utilisées pour mesurer la hauteur ou la faiblesse des prix par rapport aux trades précédents.","Box Size":"Taille de la boîte","Cancel":"Annuler","Candle":"Chandeliers","Channel [num]":"Canal [num]","Chart data is not available for this symbol.":"L\'information graphique n\'est pas disponible pour ce symbole.","Chart types":"Types de graphique","Charts":"Graphiques","Clear all":"Tout effacer","CLOSED":"FERMÉ","Color":"Couleur","Continuous":"Continu","Continuous [num]":"Continus [num]","CSV":"CSV","Dark":"Sombre","day":"jour","days":"jours","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Développé par Larry Williams, Williams %R est un indicateur d\'impulsion qui est l\'inverse de l\'Oscillateur Rapide Stochastique. Il est aussi appelé %R, Williams %R reflète le niveau de la clôture par rapport au plus haut pour la période observée.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"Développé par Tushar Chande en 1995, Aroon est un système indicateur qui détermine si l\'action est orientée à la hausse ou non et quel est la vigueur de la tendance. Il y a deux indicateurs séparés: Aroon-Haut et Aroon-Bas. Un Aroon-Haut de 25 jours mesure le nombre de jours depuis le plus haut parmi ces 25 jours. Un Aroon-Bas de 25 jours mesure le nombre de jours depuis le plus bas parmi ces 25 jours.","Display data for a specific date and time":"Afficher les données pour une date et une heure précises","Display remaining time for each interval":"Afficher le temps restant pour chaque intervalle","Display the highest and lowest spot price":"Afficher le prix au comptant le plus élevé et le plus bas","Done":"Terminé","Download":"Télécharger","Drawing tools":"Outils graphiques","Favorites":"Favoris","Fib Fan [num]":"Fib Fan [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Les fractales sont des indicateurs sur des graphiques en chandeliers qui identifient les points de retournement du marché. Les traders souvent utilisent les fractales pour avoir une idée à propos de la direction dans laquelle le prix va se diriger. Un fractal se formera lorsqu\'un schéma de prix particulier se produit sur le graphique.","H":"H","Highest and lowest spot":"Point le plus haut et le plus bas","Historical data mode":"Mode de données historiques","Hollow":"Vide","Horizontal [num]":"Horizontal [num]","hour":"heure","hours":"heures","Indicators":"Indicateurs","Interval duration":"Durée du l\'intervalle","Kagi":"Kagi","L":"L","Language":"Langue","Last digits stats for latest 1000 ticks on":"Statistiques du dernier chiffre pour les derniers 1000 ticks sur","Light":"Vif","Line [num]":"Ligne [num]","Line Break":"Line Break","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"MACD est un indicateur de trading utilisé dans l\'analyse technique de prix des actions. Il est censé révéler des changements dans la force, la direction, le momentum, et la durée de tendance des prix de l\'action.","Markets":"Marchés","minute":"minute","minutes":"minutes","Momentum":"","Moving averages":"","Network status":"Statut réseau","No results for":"Aucun résultat pour","OHLC":"OHLC","Opens in:":"Ouverture dans :","Others":"","Overwrite":"Écraser","Platform settings":"Paramètres de la plateforme","PNG":"PNG","Point & Figure":"Point & Figure","Price Lines":"Lignes de prix","Range":"Gamme","Range Bars":"Amplitude","Ray [num]":"Ray [num]","Rectangle [num]":"Rectangle [num]","Renko":"Renko","Reset":"Réinitialiser","Result":"Résultat","Retrieving Chart Data...":"Récupération des données du graphique...","Retrieving Chart Engine...":"Récupération du moteur graphique...","Retrieving Market Symbols...":"Récupération des Symboles du Marché...","Retrieving Trading Times...":"Récupération des Temps de Trading...","Reversal":"Renversement","Reversal Percentage":"Pourcentage de Renversement","Right click to delete":"Cliquez droit pour supprimer","Right click to manage":"Cliquez droit pour gérer","Saved templates":"Modèles sauvegardés","Search...":"Rechercher...","Select language":"Sélectionnez une langue","Select theme":"Sélectionnez un thème","Settings":"Paramètres","Size":"Volume","Streaming for [symbol] is not available due to license restrictions":"Diffusion en continu pour [symbol] n’est pas disponible en raison de restrictions de licence","Templates":"Modèles","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"L\'Indice du Mouvement Directionnel Moyen (IMDM) était développé en 1978 par J. Welles Wilder comme un indicateur de force de tendance dans une série de prix de l\'instrument financier, IMDM sera compris entre 0 et 100. Généralement, les relevés IMDM en dessous de 20 indiquent une tendance faible, et ceux au dessous de 40 indiquent une tendance forte.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"L\'Oscillateur Awesome est un indicateur utilisé pour mesurer le momentum du marché. OA calcule la différence entre les Moyennes Mobiles Simples de 34 et de 5 périodes. Les Moyennes Mobiles Simples qui ne sont pas calculés en utilisant le prix de clôture mais plutôt chaque barre du milieu. OA est généralement utilisé pour affirmer les tendances ou pour anticiper de possible retournements.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"L\'indice de la Filière des Matières Premières (IFMP) est un indicateur versatile qui peut être utilisé pour identifier une nouvelle tendance ou alerter sur des conditions extrêmes.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"L\'oscillateur de prix détendu (DPO) aide à identifier les cycles de prix sans l\'influence des tendances à court et à long terme. Le DPO compare une moyenne mobile simple à un prix historique au milieu d\'une période donnée. Il montre également les pics et les baisses au cours de cette période particulière, ce qui facilite la prédiction des points d\'achat.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"Le canal de Donchian est un indicateur utilisé dans le marché du trading développé par Richard Donchian. Il se forme en prenant le plus haut et le plus bas des dernières périodes n. La zone entre le plus haut et le plus bas est le canal pour la période choisie.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"L\'oscillateur Gator aide à détecter les changements de tendance du prix du marché. Sur la base de l\'indicateur Alligator, le Gator trace 2 histogrammes de chaque côté de la ligne zéro. La phase de sommeil (absence de tendance) se produit lorsque les barres des deux côtés sont rouges. La phase d\'éveil (formation d\'une tendance) se produit lorsqu\'il y a des barres rouges et vertes des deux côtés. Lorsqu\'il y a des barres vertes des deux côtés, cela indique la phase de consommation (renforcement des tendances). Une barre rouge solitaire apparaissant après la phase de repas indique le début de la phase rassasiée (tendance approchant de sa fin).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"Le nuage Ichimoku, également connu sous le nom d\'Ichimoku Kinko Hyo, est un indicateur polyvalent qui définit le support et la résistance, identifie la direction de la tendance, évalue l\'élan et fournit des signaux de trading. Ichimoku Kinko Hyo se traduit par «un graphique d\'équilibre en un seul regard».","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"La moyenne mobile (MA) aide à identifier la tendance globale du marché en filtrant les fluctuations de prix à court terme. À l\'aide de données historiques, il calcule le prix moyen sur une période spécifique et trace une ligne sur le graphique. Si la ligne MA se déplace vers le haut, c\'est un indicateur d\'une tendance haussière, une tendance baissière si elle se déplace vers le bas. Un signal d\'achat se produit lorsque le prix se déplace au-dessus de la ligne MA.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"L\'enveloppe moyenne mobile (MAE) permet d\'identifier un mouvement de prix important qui indique le début d\'une tendance. Le MAE crée une ligne moyenne mobile ainsi que 2 bandes autour d\'elle. En théorie, lorsque le prix du marché touche les bandes supérieures ou inférieures, une inversion de tendance se produit, indiquant un signal d\'achat.","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"La parabolique SER (Stop Et Retournement) est calculée presque indépendamment de chaque tendance de prix. Quand le prix est dans une tendance haussière, le SER émerge d\'en dessous du prix et se dirige vers celui-ci. Similairement, sur une tendance baissière, la SER émerge au dessus du prix et est en tendance baissière. A chaque étape à l\'intérieur d\'une tendance, le SER est calculé avec une période d\'avance.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"L\'indicateur du prix de Taux de Change (TDC) affiche une différence entre le prix actuel et le prix des périodes précédentes x. La différence peut être affichée soit en points soit en pourcentage.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"La Rainbow Moving Average (RMA) affiche plusieurs lignes de moyenne mobile simultanément. Lorsque les lignes se croisent, c\'est un indicateur d\'inversion de prix et l\'angle des lignes est utile pour prédire la force de la tendance. Plus la courbe est raide, plus la tendance est forte. Lorsque le prix franchit les lignes moyennes mobiles par le bas, il signale une tendance à la hausse. Lorsque le prix franchit les lignes moyennes mobiles d\'en haut, il signale une tendance à la baisse. Le RMA est plus facile à utiliser que d\'utiliser plusieurs indicateurs de moyenne mobile différents à la fois.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"L\'Indice de Force Relative (IFR) a été publié par J. Welles Wilder. Le prix actuel est normalisé en pourcentage entre 0 et 100. Le nom de l\'oscillateur est trompeur car il ne compare pas l\'instrument relativement à un autre instrument ou un ensemble d\'instruments, mais aussi représente le prix actuel par rapport à d\'autres pièces récentes à l\'intérieur de la fenêtre de temps selectionnée.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"L\'indice Stochastic Momentum (SMI) aide à identifier les conditions de surachat ou de survente sur le marché et à prédire les tendances baissières ou haussières. Il calcule la distance entre le cours de clôture actuel et la médiane de la fourchette haute / basse, et affiche 2 lignes sur le graphique: la première (connue sous le nom de% K) représente le mouvement des prix tandis que la seconde (connue sous le nom de %D) est un moyenne mobile de la première ligne. Si le cours de clôture est supérieur à la médiane de la fourchette haute / basse, le SMI renvoie une valeur positive. Si le cours de clôture est inférieur au prix moyen, une valeur négative est renvoyée. Les valeurs supérieures à 40 indiquent une tendance haussière tandis que les valeurs inférieures à -40 indiquent une tendance baissière.","Themes":"Thèmes","There are no favorites yet.":"Il n’y a pas encore de favoris.","tick":"tick","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"Intervalle de tick disponible uniquement pour  \\\\\\"Area\\\\\\" type de graphique.","Time interval":"Intervalle de temps","Trend":"","Trend [num]":"Tendance [num]","Try checking your spelling or use a different term":"Essayez de vérifier votre orthographe ou utilisez un terme différent","Underlying Assets":"Actifs sous-jacents","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"Il est permis d\'activer au maximum 5 indicateurs.","Vertical [num]":"Vertical [num]","Volatility":"","Would you like to overwrite it?":"Aimeriez vous le remplacer?","You have no active drawings yet.":"Vous n\'avez pas encore de dessins actifs.","You have no active indicators yet.":"Vous n\'avez pas encore d\'indicateurs actifs.","You have no saved templates yet.":"Vous n\'avez pas encore enregistré de modèle.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag aide à identifier les inversions de tendance et filtre les mouvements de prix relativement petits en déterminant les niveaux de support et de résistance du marché. Il accepte un pourcentage d\'écart comme entrée et affiche une ligne si le changement de prix est supérieur au pourcentage d\'écart. Zig Zag ignore tout mouvement latéral et est utile pour filtrer le «bruit du marché».","Zoom in":"Effectuer un zoom avant","Zoom out":"Effectuer un zoom arrière"}')}}]);
